import React ,{Component} from 'react';

class vacaciones extends Component{
    constructor(props){
        super(props);
        this.state={
            hello:'DE VACACIONES'
        }
    }
    render(){
        return(
        <h1>{this.state.hello}</h1>
        )
    }
};

export default vacaciones;
